import React from 'react';

const Video = props => {
    const srcFull = 'https://www.youtube.com/embed/' + props.src;

    const baseJSX = <div className='video'>
    <h3 className="tertiary-title">{props.videoTitle}</h3>
    <div className="iframe-container">
        <iframe type="text/html" frameborder="0" allowfullscreen="" src={srcFull} data-youtubeid="G4doTGQPRPw" data-translatedyoutubeid="G4doTGQPRPw" tabindex="0"></iframe>
    </div>;

    const JSX = baseJSX + <div className='video-description'>
                <h3 className='tertiary-title'>Exercise</h3>
                <a href="https://replit.com/@CodingICSM/Accessing-Individual-Elements#main.py" target='_blank'>Repl</a>
            </div>
        </div>;

    return (
        JSX
    );
}

export default Video;
